            return False
        if size % 2 == 1:
            return False
        return True
    def dfs(size, depth):
        if depth == 0:
            return 1
        if depth == 1:
            return 1
        if size == 2:
            return 1
        count = 0
        for i in range(2, size, 2):
            count += dfs(i, depth-1) * dfs(size-i, depth-1)
        for j in range(2, size, 2):
            count += dfs(j, depth-1) * dfs(size-j, depth-1)
        return count % MOD
    MOD = 998244353
    ans = 0
    for i in range(1, n+1):
        if is_perfectly_balanced_striped(i):
            ans += dfs(i, i-1)
        ans %= MOD
    return ans

