                                    dist[neighbor] = d+weight
                                queue.append((neighbor,d+weight)
    # Count the number of edges not contained in the shortest path
    count = 0
    for i in range(N):
        for j in range(N):
            if i!=j:
                for neighbor,weight in graph[i]:
                    if dist[i] + weight + dist[j] == float('inf'):
                        count += 1
