    tree = {i: [] for i in range(1, n+1)}
    for a, b in edges:
        tree[a].append(b)
        tree[b].append(a)

    def dfs(node, parent, depth):
        for child in tree[node]:
            if child != parent:
                yield depth + 1
                yield from dfs(child, node, depth+1)

    def f(s, t):
        return min(dfs(t, s, 0))

    return sum(f(s, t) for s in range(1, n) for t in range(s+1, n))

