    def course_schedule(n, prerequisites):
        graph = [[] for _ in range(n)]
        for pair in prerequisites:
            graph[pair[1]].append(pair[0])
        visited = [False] * n
        stack = []
        for i in range(n):
            if not visited[i]:
                dfs(graph, i, visited)
        stack.reverse()
        while stack and not visited[stack[-1]:
            node = stack.pop()
            visited[node] = True
            for neighbor in graph[node]:
                if not visited[neighbor]:
                    return False
        return True

    n = len(prerequisites)
    return course_schedule(n, prerequisites)
