    def kruskal(edges):
        parent = [-1]*(n+1)
        rank = [0]*(n+1)
        edges.sort(key=lambda x: x[2])
        MST = []
        for edge in edges:
            u,v,w = edge
            pu = find_parent(parent,u)
            pv = find_parent(parent,v)
            if pu != pv:
                if rank[pu] > rank[v]:
                    parent[pu] = pv
                    rank[v] += rank[pu]
                else:
                    parent[v] = pu
                    rank[pu] += rank[v]
                MST.append(edge)
        return MST
    MST = kruskal(edges)
    if len(MST) == n-1:
        return 0
    edges.sort(key=lambda x: x[2])
    k = sum(x[2] for x in MST)
    for i in range(n-1,m):
        if edges[i][2] < k:
            return i+1
    return 0

