def solution(input_string):
    N = int(input())
    A = list(map(int, input_string.strip().split()))
    if N == 1:
        return 1
    if N == 2:
        return 1
    mod = 10**9+7
    dp = [1] * (N+1)
    for i in range(2, N+1):
        dp[i] = (dp[i-1] * (N-i+1) + dp[i-2] * i) % mod
    ans = dp[N]
    for i in range(1, N):
        if A[i] == 0:
            ans = (ans - dp[i-1]) % mod
        elif A[i] == 1:
            ans = (ans - dp[i]) % mod
        else:
            ans = 0
            break
    return ans

