    def dfs(n, a, b, depth, memo):
        if depth == n:
            return 0
        if (n, a, b, depth) in memo:
            return memo[(n, a, b, depth)]
        if a == 0:
            return dfs(n, 0, b, depth + 1, memo) + 1
        if b == 0:
            return dfs(n, a, 0, depth + 1, memo) + 1
        if a == b:
            return dfs(n, a - 1, b, depth + 1, memo) + dfs(n, b - 1, depth + 1, memo)
        if a > b:
            return dfs(n, a - 1, b, depth + 1, memo) + 1
        else:
            return dfs(n, a, b - 1, depth + 1, memo) + 1

